INSERT INTO `product` (`id`, `name`, `stock_qty`, `category`, `price`, `description`, `image`) VALUES
(1, 'Diamicron MR 60mg Tablet', 100, 'Medicine', 108, 'Precautions\r\nPrecautionary Steps of Diamicron MR 60mg Tablet\r\nBefore taking Diamicron MR medication, please consult doctor\'s advice especially if you have any of the following illnesses.\r\n\r\nAllergy to Sulfonylureas\r\nAllergy to Sulfonamides\r\nType I diabetes\r\nPre-Communal Diabetics\r\nDiabetic Coma\r\nDiabetic ketoacidosis\r\nKidney problem\r\nHeart problems\r\nAllergies to Diamicron MR or any other ingredients\r\nIt is not recommended for use by baby children. Please keep it away from children\r\nHypersensitivity\r\nPlease stop taking the medication if you have the following symptoms of Diamicron MR\r\nReactions vary by individual. You are encouraged to ask your doctor about the possibility of reactions between the medicines before taking them.\r\n\r\nMiconazole\r\nPhenylbutazone\r\nBeta-blockers\r\nFluconazole\r\nNSAIDs\r\nClarithromycin\r\nChlorpromazine\r\nAlcohol\r\nSalbutamol\r\nRitodrine\r\nBefore you take this medicine, please be aware of the following warnings:\r\nAvoid excessive exposure to sunlight\r\nAvoid using this medication prolonged\r\nAlcohol may affect your liver if taken with this medicine\r\nTell your doctor about other diseases you are experiencing or about other medicines you are using. Do not stop taking medicines that have been determined by the doctor.\r\n\r\nAlcohol Warning (Not Advisable)\r\nAlcohol may accentuate hypoglycaemic effect caused by Diamicron MR 60mg Tablet. Thus, it is not advisable to consume alcohol during the treatment with Diamicron MR 60mg Tablet.\r\n\r\nPregnancy Warning (Not Safe)\r\nAnimal studies have shown reproductive toxicities and prolonged severe hypoglycaemia has been reported in newborns to mother receiving Diamicron MR 60mg Tablet at time of delivery. Thus, it is contraindicated during pregnancy. Please consult your doctor.\r\n\r\nBreastfeeding Warning (Not Advisable)\r\nThere are no data on the effect of Diamicron MR 60mg Tablet upon breastfed babies. Thus, Diamicron MR 60mg Tablet is contraindicated during breastfeeding. Please consult your doctor.\r\n\r\nDriving Warning (Generally Safe)\r\nDiamicron MR 60mg Tablet usually does not affect the ability to drive. Do not drive unless you are feeling well.\r\n\r\nKidney Warning (High Risk)\r\nDose adjustment may be needed in patients with moderate kidney impairment. It is contraindicated in patients with severe kidney impairment. Please consult your doctor.\r\n\r\nLiver Warning (Use With Care)\r\nDose adjustment may be needed in patients with moderate liver impairment. It is contraindicated in patients with severe liver impairment. Please consult your doctor.\r\n\r\n\r\nSide effects\r\nAs with all medications, you may experience some side effects. Not everyone experiences it. This is not a cause for concern. However, it is so that you are aware of it.\r\n\r\nIn addition to these functions Diamicron MR and its uses, there may be side effects associated with this drug. Please see the list below:\r\n\r\nHypoglycemia\r\nNausea\r\nVomiting\r\nDiarrhea\r\nConstipation\r\nStomach pain\r\nStomach uncomfortable\r\nAlthough some common symptoms occur, there are fewer symptoms. If you have any symptoms (whether listed above or not), please speak to the doctor immediately. You should also consult your doctor if you have vision blurring or skin rashes. The above list may be incomplete and please inform if you have other symptoms. These symptoms are more pronounced if the drug is used extensively.\r\n\r\nHypoglycaemia, Allergic reaction, Blurred vision, Abdominal pain, Diarrhea, Nausea, Vomiting, Cholestatic jaundice', );
