(5, 'Salixium COVID-19 Home Rapid Antigen Test Kit (RTK) - Saliva/Nasal Samples\r\n', 100, 'Test Kit', 9.9, 'This test kit allows self testing of Covid-19 antigen performed anywhere like your home or your office, without needing to get tested at a healthcare facility.\r\n\r\nWhy use this?\r\n\r\nEasy\r\nUser-friendly\r\nCan be self-administered\r\nWhy Nasal and Saliva Sample Collection?\r\nSelf collected nasal samples or saliva samples alone may miss certain detection of viral load. Combining both saliva and nasal swab samples have advantage to increase detection rate.\r\n\r\nSpecifications of Salixium Covid-19 Antigen - Saliva/Nasal Samples\r\nSensitivity 91.4%\r\nSpecificity 100.0%', );
