(6, 'Bad Lab Hair Gel 150ml\r\n', 100, 'Personal Care', 14.99, 'General Introduction:\r\n\r\nThe holding power for a slick and sleek look. This non-grease bag formula comes with purifying FluidiPure8G, to keep scalp irritations, odors, and bad hair days at bay. Its a dog-eat-dog world but it doesnt mean you have to look like one.\r\n\r\nIngredients:\r\n\r\nWater, Alcohol Denat., Vinyl Caprolactam/VP/Dimethylaminoethyl Methacrylate Copolymer, PVP, PEG-40 Hydrogenated Castor Oil, Fragrance, Carbomer, Aminomethyl Propanol, FluidiPure 8G (Hexylene Glycol, Capryloyl Glycine, Xylitylglucoside), Tetrasodium EDTA, Phenoxyethanol, Ethylhexylglycerin, Butylphenyl Methylpropional, Alpha-Isomethyl Ioneone, Coumarin, Limonene, Linalool\r\n\r\nDirection of Use:\r\n\r\nHow to use: Apply and spread evenly on moist or dry hair. Shape the hair as desired. Ideal for all hair types.\r\n\r\nIn case of contact with eyes, rinse with water immediately. Keep out of reach of children. For external use only', );
