(7, 'Cialis 5mg Tablet', 50, 'Medicine', 249.9, 'Introduction of Cialis 5mg Tablet\r\nCialis 5mg tablet is a prescription medication and should be taken as advised by your doctor. \r\n\r\nCialis 5mg tablet can be taken on an empty stomach or with a meal. It should be taken strictly as prescribed by the doctor. The amount of time it takes to work differs from person to person, but it usually takes between 30 minutes and one hour. Just take it whenever you need it because it has been recommended by your doctor. \r\n\r\nThis medication is not meant for use by women. Men should stop taking any other treatment to cure impotence without consulting to a doctor. It could be unsafe to take it along with medication called nitrates. Before taking this medication, you can inform the doctor whether you are taking or have recently taken some other medicines for the same disease or illness. You should not drive if you feel dizzy with this medication.Stop drinking alcohol when taking this medication as it can cause side effects.', );
